import React from "react";

const QUESTIONS = [
  {
    id: 1,
    title: "Print Hello World",
    starterCode: `console.log("Hello World");`
  },
  {
    id: 2,
    title: "Sum of Two Numbers",
    starterCode: `function sum(a, b) {\n  return a + b;\n}\n\nconsole.log(sum(2, 3));`
  },
  {
    id: 3,
    title: "Find Max in Array",
    starterCode: `const arr = [3, 7, 2, 9];\n\nlet max = arr[0];\nfor (let i = 1; i < arr.length; i++) {\n  if (arr[i] > max) max = arr[i];\n}\n\nconsole.log(max);`
  }
];

export default function QuestionBank({ onSelect }) {
  return (
    <div className="question-bank">
      <h3>ðŸ“š Question Bank</h3>

      {QUESTIONS.map((q) => (
        <button
          key={q.id}
          className="question-item"
          onClick={() => onSelect(q.starterCode)}
        >
          {q.title}
        </button>
      ))}
    </div>
  );
}
